import React from 'react';
import ProductCard from '../../Component/ProductCard/ProductCard.js';
import data from '../../data/products.json';

import { instanceAxs } from '../../api/Api.js';
import { fileApi } from '../../config/cfg.js';

class Menu extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            apiMsg: ''
        }
    }

     getItems () {
        instanceAxs.get(`${fileApi}/getmenuitems`)
        .then(response => {
            console.log(response);
        })
    }
    componentDidMount(){
        this.getItems();
    }
    
    render(){
        return(
            <div className="container" id="menu-div">
                <div className="row">  
                    {data.map(data => {
                        return(
                            <div className="col-md-4 mb-4" key={data.name}>
                                <ProductCard 
                                    img={data.images} 
                                    price={data.price} 
                                    name={data.name} 
                                    location={data.location} 
                                    id={data.id}
                                    data={data}/>
                            </div>
                        ) 
                    })}                                                      
                </div>
            </div>       
        )
    }   
}

export default Menu;
